$().ready(function(){$(".deleteMaterial").click(function(){var n=$(this);swal({title:n.attr("data-message"),text:"",type:"warning",showCancelButton:!0,confirmButtonColor:"#4285F4",confirmButtonText:"\u0628\u0644\u06cc",cancelButtonText:"\u0627\u0646\u0635\u0631\u0627\u0641",closeOnConfirm:!1},function(){$.ajax({type:"POST",url:n.attr("data-url"),data:"ieltsMaterialId="+n.attr("data-Id")+"&path="+n.attr("data-path"),dataType:"json",success:function(t){t.IsSuccessfull?(swal("\u0627\u062a\u0645\u0627\u0645 \u062d\u0630\u0641 \u0627\u0637\u0644\u0627\u0639\u0627\u062a","\u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0630\u062e\u06cc\u0631\u0647 \u0634\u062f\u0647 \u062d\u0630\u0641 \u0634\u062f","success"),$("#ieltsMaterialId_"+n.attr("data-id")).remove()):swal("\u0644\u063a\u0648 \u062d\u0630\u0641 \u0627\u0637\u0644\u0627\u0639\u0627\u062a",t.Message,"error")}})})});$("#TopicId").change(function(){$.ajax({type:"Get",url:"/IELTS/GetTopic?topicId="+$(this).val(),dataType:"json",success:function(n){console.log(n);$(".topicDetail").html(n)}})})});